import React from 'react';
import { CantactPageContainer } from './contact.styles';
import CustomButton from '../../components/custom-button/custom-button.component';
import { ButtonsBarContainer} from '../../components/sign-in/sign-in.styles';


const ContactPage = () => (
  <CantactPageContainer>
    Hi, I am Hua!
    <br />
    Please feel free to contact me if you have any questions.
    <br />
    <br />

    <ButtonsBarContainer>
      <CustomButton type='submit' inverted>
      <a href="mailto:edwardhuacong@gmail.com" target="_blank">Send Message</a>
      </CustomButton>

      <CustomButton type='submit' isGoogleSignIn>
      <a href="https://www.linkedin.com/in/huacong/" target="_blank">LinkedIn</a>
      </CustomButton>
    </ButtonsBarContainer>

  </CantactPageContainer>
);

export default ContactPage;
